import React from 'react'
import logo from './logo.svg';


export class TopBar extends React.Component {
    render() {
        return (
            <header className="App-header">
            <img src={logo} className="App-logo" alt="logo" />
            <div className="App-title1">Around</div>
            </header>
    );
    }
}
